import { LegendOrientation } from './types';

export const defaultGrid = {
  containLabel: true,
};

export const defaultYAxis = {
  scale: true,
  yAxisLabelRotation: 0,
};

export const defaultXAxis = {
  xAxisLabelRotation: 0,
};

